import numpy as np


class Solution(object):
    def productExceptSelf(self, nums):
        """
        :type nums: List[int]
        :rtype: List[int]
        """

        prods = []
        np_arr = np.array(nums)

        p_all = np_arr.prod()

        for ndx, numb in enumerate(nums):
            if numb == 1:
                prods.append(p_all)
            elif numb == -1:
                prods.append(p_all / -1)
            else:
                np_arr_new = np.delete(np_arr, ndx)
                p = np_arr_new.prod()
                prods.append(p)


        return prods

def test_solution():

    s = Solution()

    result = s.productExceptSelf(nums=NUM_ARR_SMALL)

    print(result)

